import './App.css';

let folders = ["Folder3", "Folder2", "Folder1"];

function App() {
  return (
    <div className="App">
      {folders.map((folder, index) => {
        return (
          <div className="Folder" id={folder}>
            <div className="Tab" style={{left: `${(folders.length - 1 - index) * 140 + 10}px`}}>{folder}</div>
          </div>
        );
      })}
    </div>
  );
}

export default App;
